'''387. First Unique Character in a String'''
def firstUniqChar(s):
    """
    :type s: str
    :rtype: int
    """
    if s:
        pos_list = []
        for c in set(s):
            index_list = [i for i, v in enumerate(s) if v == c]
            if len(index_list) == 1:
                pos_list.append(index_list[0])
        pos_list.sort()
        if pos_list:
            return pos_list[0]
        else:
            return -1
    return -1

